import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Login.css';
import './Home';
import image from '../assets/travel.png';

const Login = () => {
  const [email, setEmail] = useState(""); 
  const [password, setPassword] = useState(""); 
  const [errorMessage, setErrorMessage] = useState(""); 
  const navigate = useNavigate(); 

  const handleLogin = async (e) => {
    e.preventDefault();

    const loginData = {
      email, 
      password, 
    };

    try {
      const response = await fetch("http://localhost:3000/sessions", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(loginData),
      });

      const data = await response.json();

      if (response.ok) {
      
        localStorage.setItem('token', data.token);
        localStorage.setItem('user', JSON.stringify(data.user));

        console.log("Data received from server:", data);
        console.log("Storing user in localStorage:", data.user);
 
        navigate('/home');  
      } else {
        
        console.log('Login failed:', data.message || 'Unknown error');
        setErrorMessage(data.message || 'Unknown error');
      }
    } catch (error) {
      console.error('Error sending the request:', error);
      setErrorMessage('Error sending the request. Please try again.');
    }
  };

  return (
    <div className="login-container">
      <div className="login-form-container">
        <h2>Welcome Back</h2>
        <form onSubmit={handleLogin} className="login-form">
          <input 
            type="email" 
            placeholder="Email" 
            value={email} 
            onChange={(e) => setEmail(e.target.value)} 
            required 
          />
          <input 
            type="password" 
            placeholder="Password" 
            value={password} 
            onChange={(e) => setPassword(e.target.value)} 
            required 
          />
          <button type="submit">Login</button>

          {errorMessage && <div className="error-message">{errorMessage}</div>} 

          <p>
            Don't have an account?{' '}
            <span className="link" onClick={() => navigate('/signup')}>Sign up</span>
          </p>
        </form>
      </div>


  <div className="flex animate-svg-pan-left w-[2880px] h-full z-[-1] absolute">
    {/* SVG 1 */}
    <svg
      width="1440"
      height="560"
      preserveAspectRatio="none"
      viewBox="0 0 1440 560"
      className="w-[1440px] h-full bottom-0"
    >
      <defs>
        <mask id="SvgjsMask1001">
          <rect width="1440" height="560" fill="#ffffff" />
        </mask>
      </defs>
      <g mask="url(#SvgjsMask1001)" fill="none">
        <path
          d="M 0,178 C 57.6,166.2 172.8,109.4 288,119 C 403.2,128.6 460.8,245.6 576,226 C 691.2,206.4 748.8,25.6 864,21 C 979.2,16.4 1036.8,200 1152,203 C 1267.2,206 1382.4,69.4 1440,36L1440 560L0 560z"
          fill="#184a7e"
        />
        <path
          d="M 0,515 C 96,480.8 288,351.8 480,344 C 672,336.2 768,483.8 960,476 C 1152,468.2 1344,339.2 1440,305L1440 560L0 560z"
          fill="#2264ab"
        />
      </g>
    </svg>

    {/* SVG 2 (identic, pentru loop) */}
    <svg
      width="1440"
      height="560"
      preserveAspectRatio="none"
      viewBox="0 0 1440 560"
      className="w-[1440px] h-full bottom-0"
    >
      <defs>
        <mask id="SvgjsMask1001">
          <rect width="1440" height="560" fill="#ffffff" />
        </mask>
      </defs>
      <g mask="url(#SvgjsMask1001)" fill="none">
        <path
          d="M 0,178 C 57.6,166.2 172.8,109.4 288,119 C 403.2,128.6 460.8,245.6 576,226 C 691.2,206.4 748.8,25.6 864,21 C 979.2,16.4 1036.8,200 1152,203 C 1267.2,206 1382.4,69.4 1440,36L1440 560L0 560z"
          fill="#184a7e"
        />
        <path
          d="M 0,515 C 96,480.8 288,351.8 480,344 C 672,336.2 768,483.8 960,476 C 1152,468.2 1344,339.2 1440,305L1440 560L0 560z"
          fill="#2264ab"
        />
      </g>
    </svg>
  </div>


    </div>
  );
};

export default Login;
